import React, { Component } from 'react';
import Slider from "react-slick";


class HeroCarousel extends Component {

    render() {
        var settings = {

            slidesToShow: 1,
            slidesToScroll: 1
        };
        return (
            <Slider {...settings}>

                <div >
                    <video
                        id="mainVideo"
                        src="https://ernesto-perez.com/wp-content/uploads/2019/08/video.mp4"
                        autoPlay
                        loop
                        type="video/mp4">
                    </video>
                </div>
                <div>
                <div id="picture1" class="flexslider-hero-picture2"></div>
                </div>
                <div>
                <div id="picture2" class="flexslider-hero-picture3"></div>
                </div>
                <div>
                <div id="picture3" class="flexslider-hero-picture4"></div>
                </div>
            </Slider>
        );
    }
}

export default HeroCarousel;
